import React from 'react';
import classes from './Layout.module.css';
import Toolbar from '../Navigation/Toolbar/Toolbar';

const Layout = ({children}) => (
    <React.Fragment>
        <Toolbar />
        <main className={classes.Content}>
            {children}
        </main>
    </React.Fragment>
);

export default Layout;
